<?php $__env->startSection('content'); ?><p>Season 29 of Dancing With The Stars has been revealed.</p>

<p>This year's star-studded line up features Selling Sunset's Chrishell Stause, Tiger King Star Carole Baskin, Jesse Metcalfe, Nelly and more, according to People.</p>

<p>Other celebs who signed on include Backstreet Boys' AJ McLean, former Bachelorette star Kaitlyn Bristowe, Skai Jackson, Anne Heche, The Real's Jeannie Mai, and Nev Shulman, host of Catfish.</p>

<p>Star: This year's star-studded line up features Selling Sunset's Chrishell Stause, Tiger King Star Carole Baskin, Jesse Metcalfe, Nelly and more, according to People</p>

<p>Athletes include NBA star Charles Oakley, Olympic figure skater Johnny Weird and former NFL player Vernon Davis. </p>

<p>Monica, the head coach from the hit Netflix show Cheer is also signed up for this season. </p>

<p>Season 29 of DWTS kicks off on September 14. </p>
